function next(){

    var getoption = document.getElementsByName('option')
    for(var i = 0 ; i < getoption.length; i++){
        if(getoption[i].checked){
            var selectedvalue = getoption[i].value
            var selectedquestion = question[index-1]['question']
            var selectedans = question[index-1][`option${selectedvalue}`]
            var correct = question[index-1][`correctOption`]
            if(selectedans == correct){
                score++
            }
        }
        getoption[i].checked=false
    }
    button.disabled=true 

    if(index > question.length-1){
        // document.write(`your percentage is : `+((score/question.length)*100).toFixed(2))
        showResults();

    }
    else{
        
    ques.innerText = question[index].question
    opt1.innerText=question[index].option1
    opt2.innerText=question[index].option2
    opt3.innerText=question[index].option3
    index++    
    
    }

    

}
